    [],nt"revision_timestamp": "2015-05-07T06:27:56.716853",nt"name": "glas-icesat-l2-global-land-surface-altimetry-data-hdf5-v033",nt"isopen":
    true,nt"url": null,nt"notes": "GLAH14 contains the land elevation and elevation
    distribution corrected for geodetic and atmospheric affects calculated from algorithms
    fine-tuned for over land returns. Data granules contain 14 orbits of data within
    the land mask. (Suggested Usage: GLAH14 contains GLAS land elevation data that includes
    geolocation and reflectance plus the geodetic, instrument, and atmospheric corrections
    used. Parameters are at the full 40Hz resolution for locations that fall within
    the ICESat land mask. Each GLAH14 file was created from an equivalent GLA14 binary
    file. The data used to create the GLAH14 values are contained in the equivalent
    GLAHxx files for the GLAxx files. See the provenance metadata for the creation of
    the GLA14.)",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
